DROP PROCEDURE IF EXISTS `sp_reset_is_validated`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reset_is_validated`()
BEGIN
	UPDATE persons
	SET is_validated = 0, access_code = NULL, dt_updated = NULL, updated_by = NULL
	WHERE role_id = 2 AND is_deleted = 0;
END
;;
